<template>
	<div class="drawing-container">
		<div v-if="drawStatus === 'FAILURE'">
			<aidraw-error-info></aidraw-error-info>
		</div>
		<div v-else>
			<div v-if="progress < 100">
				<div class="rabbit bg-img"></div>
				<div class="tips">{{ (type === 'DESCRIBE' ? '正在生成中' : '正在画图中') + progress }}%，请耐心等待片刻</div>
				<div class="progress-wrapper">
					<div class="progress" :style="{ width: progressWidth }"></div>
				</div>
			</div>
			<div v-else>
				<el-image v-if="!errorImg" @click="visiblePreviewImg=true" class="picture" fit="scale-down" :src="imgUrl" >
					<div slot="error" class="picture" >
						<img style="width: 100%" src="@/static/images/draw/jiazai_shibai@2x.png" alt="">
					</div>
				</el-image>
				<aidraw-error-info v-else errorType="load-error"></aidraw-error-info>
				<aidraw-input-end :action="action" :prompt="prompt" @choosePrompt="handleChoosePrompt"
					@redoImage="handleRedoImage" @redoDescribe="handleRedoDescribe" @deleteImage="handleDeleteImage"
					@tranformImage="handleTranformImage" @downloadImage="handleDownloadImage"></aidraw-input-end>
			</div>
		</div>


		<gpt-preview-img :src="imgUrl" v-model="visiblePreviewImg"></gpt-preview-img>
	</div>
</template>

<script>
	import AidrawInputEnd from "../input-end/index.vue";
	import aidrawErrorInfo from '@/components/h5/aidraw/error-info/index.vue';
	import aidrawInputEnd from '@/components/h5/aidraw/input-end/index.vue';
	import gptPreviewImg from '@/components/h5/gpt/preview-img/index.vue';
	import {
		getTaskById
	} from "@/api/h5";

	export default {
		components: {
			AidrawInputEnd,
			aidrawErrorInfo,
			aidrawInputEnd,
			gptPreviewImg,
		},
		props: {
			taskId: String,
			content: String,
			type: String
		},
		data() {
			return {
				progress: 0,
				drawStatus: "SUBMITTED",
				imgUrl: "",
				errorImg: "",
				prompt: "",
				interval: 1000,
				space: 1,
				progressMax: 99,
				action: "",
				timer: null,
				visiblePreviewImg: false
			};
		},
		computed: {
			progressWidth() {
				const result = (this.progress / 100) * 534.0;
				return result + "px";
			},
		},
		mounted() {
			let index = 0;
			const startQuery = () => {
				if (this.drawStatus === "SUCCESS") {
					this.progressMax = 100;
					this.interval = 50;
					this.space = 10;
				} else if (this.drawStatus === "FAILURE") {
					console.log(this.drawStatus)
					this.progressMax = 100;
					this.interval = 50;
					this.space = 50;
				} else {
					if (index % 3 == 0) {
						// 查询状态
						// console.log(`查询状态`);
						this.queryStatus();
					}

					if (index > 25) {
						this.interval += 200;
					} else if (index > 50) {
						this.interval += 300;
					} else if (index > 75) {
						this.interval += 500;
					} else if (index > 90) {
						this.interval += 1000;
					}
				}

				index++;

				if (this.progress < this.progressMax) {
					this.progress += this.space;
				}

				this.timer = setTimeout(() => {
					if (this.progress < 100) {
						startQuery();
					}
				}, this.interval);
			};
			startQuery();
		},
		destroyed() {
			this.timer && clearTimeout(this.timer)
		},
		methods: {
			async queryStatus() {
				try {
					const {
						data
					} = await getTaskById(this.taskId);
					this.drawStatus = data.status;
					if (data.status === "SUCCESS") {
						this.action = data.action;
						if (data.picture) {
							this.imgUrl = data.picture;
						} else {
							this.errorImg = `/static/images/draw/jiazai_shibai@2x.png`;
						}

						this.prompt = (data.promptEn);
					}
				} catch (error) {
					this.drawStatus === "FAILED";
				}
			},
			handleChoosePrompt(text) {
				this.$emit("choosePrompt", text);
			},
			handleRedoImage() {
				this.$emit("redoImage", {
					taskId: this.taskId,
					content: this.content,
				});
			},
			handleRedoDescribe() {
				this.$emit("redoDescribe", {
					taskId: this.taskId,
					content: this.content,
				});
			},
			handleDeleteImage() {
				this.$emit("deleteImage", this.taskId);
			},
			handleTranformImage(op) {
				this.$emit("tranformImage", {
					op,
					taskId: this.taskId,
				});
			},
			handleDownloadImage() {
				window.open(this.imgUrl)
			},
		},
	};
</script>

